(window.webpackJsonp=window.webpackJsonp||[]).push([[6],{FQlY:function(n,r){n.exports="首先介绍个网站 [codewars](http://www.codewars.com/r/eVdvRA ) 一个编码社区，做题升级跟玩游戏一样，在获得乐趣的同时还能得到很大的提升，还可以看看大神级的代码。。。。\r\n题目：写一个方法 输出所有的可能的子数组，就是排列组合了\r\n``` \r\npower([1,2,3]);  => [[], [1], [2], [1, 2], [3], [1, 3], [2, 3], [1, 2, 3]]\r\n```   \r\n先来大神的代码\r\n```\r\nfunction power(s) {\r\n  return s.reduce( function(p, e) {\r\n      return p.concat( p.map ( function(sub) { \r\n        return sub.concat([e]);}));\r\n    }, [[]]);\r\n}\r\n```\r\n表示大神的代码一开始看不懂啊，设了断点才明白，就是每次循环取源数组一个数，对结果数组(初始化[[]])的每个子项做concat，并添加到结果数组中，并参与下次循环循环步骤如下：\r\n```\r\n[[]]\r\n[[],[1]]\r\n[[],[1],[2],[1,2]]\r\n[[],[1],[2],[1,2],[3],[1,3],[2,3],[1,2,3]]\r\n```   \r\n我自己的实现方法，哎。。。 不看也罢\r\n顺便说下，一开始用这个网站的时候找不到修改头像的地方，后来发现，account settings里面有个social 连接上你的github账号就会换成github的头像了。。\r\n"},"N+SW":function(n,r,t){"use strict";t.r(r);var e=t("q1tI"),c=t.n(e),o=t("IujW"),u=t.n(o),a=t("FQlY"),s=t.n(a);r.default=function(){return c.a.createElement(u.a,{source:s.a,htmlMode:"raw"})}}}]);